/*ReinforcedManagementReport = Lista de Informe Reforzado*/
import React, { useState } from "react";
import PropTypes from "prop-types";

import { Card, CardBody, Button, CardFooter } from "reactstrap";

//Import Breadcrumb

import Breadcrumb from "../../../../../components/Common/Breadcrumb";

//i18n
import { withTranslation } from "react-i18next";


import Formulario from "./Fromulario"
const PantallaBusqueda = (props) => {
  const [showResults, setShowResults] = useState(false);
  const [dataList, setDataList] = useState([]);
  const [loading, setLoading] = useState(false);
  const [displayClienteModal, setDisplayClienteModal] = useState(false);

 

  return (
    <React.Fragment>
      <div className="page-content">
        <Breadcrumb title={props.t("Colateral")} breadcrumbItem={props.t("Garantias Muebles(Autos)")} />

        <Card>
          <CardBody>
            <Formulario />
          </CardBody>
            <CardFooter style={{textAlign:"right"}}>  
              
                <Button color="success" type="button" style={{ margin: '5px' }} ><i className=""></i> {props.t("Guardar")}</Button>
                <Button color="success" type="button" style={{ margin: '5px' }} ><i className=""></i> {props.t("Añadir")}</Button>
              </CardFooter>
        </Card>
      </div>
    </React.Fragment>
  );
};

export default withTranslation()(PantallaBusqueda);
